import './App.css';
import ReactDOM from 'react-dom'
import React from 'react'
import { render } from "react-dom";
import axios from "axios";
import Home from './Home';

import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
     <BrowserRouter>
        <Switch>
          <Route path="/home">
            <Home />
          </Route>
          {/* <Route path="/narwhal">
            <Narwhal />
          </Route>
          <Route path="/whale">
            <Whale />
          </Route> */}
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
